content.css:
.test-container {
  padding: 20px;
  border: 2px solid #ccc;
  border-radius: 8px;
  margin: 10px;
}

.test-button {
  background: #4F46E5;
  color: white;
  padding: 10px 20px;
  border: none;
  border-radius: 4px;
  cursor: pointer;
}

.result {
  margin-top: 10px;
  padding: 10px;
  background: #f0f0f0;
}

content.javascript:
console.log('Script starting...');
const button = document.querySelector('.test-button');
const result = document.querySelector('.result');
console.log('Found elements:', button, result);

if (button && result) {
  // Direct event listener attachment
  button.onclick = function(event) {
    console.log('Button clicked!', event);
    result.textContent = 'Clicked at: ' + new Date().toLocaleTimeString();
  };
}
